#importing all relevant libraries
import pandas as pd
import matplotlib.pyplot as plt
from sklearn.linear_model import LinearRegression
from sklearn.model_selection import train_test_split
from sklearn.metrics import mean_squared_error

#read the csv data file
df=pd.read_csv('diabetes.csv')
df.head()

#checking null values
df.isnull()

#removing all null values if they are present
df.dropna(inplace=True)

x=df[['Glucose']] #setting independent variable as the glucose level
y=df[['DiabetesPedigreeFunction']] #setting dependent variable as the diabetes pedigree function
x_train, x_test, y_train, y_test = train_test_split(x,y, test_size= 0.2)#splits the data in test and train

"""We have chosen glucose level as independent variable and diabetes pedigree level as the dependent variable. We want to see the relation between glucose levels and the diabetes pedegree as the dependent variable."""

model = LinearRegression() #Create a linear regression model
model.fit(x_train,y_train)

y_prediction = model.predict(x_test)

plt.figure(figsize=(7, 7))
plt.scatter(x_test,y_test,color='black')
plt.plot(x_test,y_prediction,'green')
plt.xlabel('Glucose level')
plt.ylabel('Diabetes level')

#finding the mean squarred error
error=mean_squared_error(y_test,y_prediction)
print('Error is : ',error)

"""![image.png](data:image/png;base64,)



"""

b0=model.intercept_#intercept
b1=model.coef_#slope
print('The equation is {} + {}x'.format(b0,b1))#equation of regression line

